"""
This script performs the following:
    + Prompts to import:
        - One or more source Excel files
        - One target Excel file
    + Asks for the header row and the name of the key column (used to match rows across files)
    
It then checks the master key of each row from the source files against the target file.

Some cells in source files are marked with a letter, like 'V' or 'X', which you'll be prompted to specify.
This value can appear in multiple columns for each key.

It doesn't matter:
    - whether the marker is uppercase or lowercase
    - whether source or target files are filtered in Excel
"""

