from openpyxl import load_workbook
import tkinter as tk
from tkinter import simpledialog, messagebox, filedialog
from PIL import Image, ImageTk
import pandas as pd

#################################### Variables

POPUP_WIDTH = 400
POPUP_HEIGHT = 150
splash_window = None
splash_root = None

SPLASH_IMAGE_BASE64 = ""

#################################### Splash Screen (background mode)

def show_background_splash():
    global splash_window, splash_root

    splash_root = tk.Tk()
    splash_root.withdraw()  # Hide the root window

    splash_window = tk.Toplevel(splash_root)
    splash_window.overrideredirect(True)
    splash_window.attributes("-topmost", True)

    try:
        # Decode BASE64 image
        import base64
        from io import BytesIO
        image_data = base64.b64decode(SPLASH_IMAGE_BASE64)
        image = Image.open(BytesIO(image_data)).resize((880, 555))
        splash_image = ImageTk.PhotoImage(image)

        img_width, img_height = splash_image.width(), splash_image.height()
        screen_width = splash_window.winfo_screenwidth()
        screen_height = splash_window.winfo_screenheight()

        # Position splash window on the left side
        x = 0
        y = (screen_height // 8) - (img_height // 8)

        splash_window.geometry(f"{img_width}x{img_height}+{x}+{y}")
        label = tk.Label(splash_window, image=splash_image)
        label.image = splash_image
        label.pack()

        splash_window.update()
        return splash_window
    except Exception as e:
        print(f"Failed to load splash image from BASE64 data:", e)
        splash_window.destroy()
        splash_window = None
        return None

def close_splash():
    global splash_window, splash_root
    if splash_window is not None:
        splash_window.destroy()
        splash_window = None
    if splash_root is not None:
        splash_root.destroy()
        splash_root = None

#################################### GUI Functions

def right_side_window(title, width=POPUP_WIDTH, height=POPUP_HEIGHT):
    root = tk.Tk()
    root.withdraw()  # Hide the root window
    root.title(title)
    
    # Calculate position for the right side of the screen
    screen_width = root.winfo_screenwidth()
    screen_height = root.winfo_screenheight()
    x = screen_width - width - 50  # 50 pixels from the right edge
    y = (screen_height - height) // 2  # Centered vertically
    
    root.geometry(f"{width}x{height}+{x}+{y}")
    return root

def select_multiple_files(title):
    root = right_side_window(title)
    root.withdraw()  # Hide the root window before showing dialog
    paths = filedialog.askopenfilenames(title=title, filetypes=[("Excel files", "*.xlsx")], parent=root)
    root.destroy()
    if not paths:
        messagebox.showwarning("Cancelled", "Operation cancelled by user.")
        sys.exit(0)
    return paths

def select_single_file(title):
    root = right_side_window(title)
    root.withdraw()  # Hide the root window before showing dialog
    path = filedialog.askopenfilename(title=title, filetypes=[("Excel files", "*.xlsx")], parent=root)
    root.destroy()
    if not path:
        messagebox.showwarning("Cancelled", "Operation cancelled by user.")
        sys.exit(0)
    return path

def ask_header_row():
    root = right_side_window("Header Row")
    while True:
        try:
            row_str = simpledialog.askstring("Header Row", "Enter the row number containing headers (number > 0):", parent=root)
            if row_str is None:
                messagebox.showwarning("Cancelled", "Operation cancelled by user.")
                root.destroy()
                sys.exit(0)
            row_num = int(row_str)
            if row_num < 1:
                messagebox.showerror("Invalid Input", "Please enter a positive number.")
                continue
            return row_num
        except ValueError:
            messagebox.showerror("Invalid Input", "Please enter a valid number.")

def ask_key_column_name(df_columns):
    root = right_side_window("Key Column")
    column = simpledialog.askstring("Key Column", "What is the name of the key column?", parent=root)
    root.destroy()
    if column is None:
        messagebox.showwarning("Cancelled", "Operation cancelled by user.")
        sys.exit(0)
    return column.strip().rstrip(".,").lower()

def ask_marker_value():
    root = right_side_window("Marker Value")
    value = simpledialog.askstring("Marker Value", "Which value should I search for in the source files?", parent=root)
    root.destroy()
    if value is None:
        messagebox.showwarning("Cancelled", "Operation cancelled by user.")
        sys.exit(0)
    return value.strip().upper()

#################################### Processing Functions

def find_marked_columns(source_file, header_row, key_column_name, marker_value):
    try:
        df = pd.read_excel(source_file, header=header_row - 1)
        normalized_columns = {str(col).strip().rstrip(".,").lower(): col for col in df.columns}
        key_column_original = normalized_columns[key_column_name]

        marked_columns = []

        for column in df.columns:
            if column == key_column_original or str(column).startswith('Unnamed:') or not str(column).strip():
                continue
            column_values = df[column].dropna().astype(str).str.strip().str.upper()
            if any(val == marker_value for val in column_values):
                marked_columns.append(column)
                df[column] = df[column].apply(
                    lambda x: marker_value if pd.notna(x) and str(x).strip().upper() == marker_value else None
                )

        return marked_columns, df, key_column_original
    except Exception as e:
        messagebox.showerror("Error", f"Error reading file:\n{source_file}\n\n{str(e)}")
        return [], None, None

def update_target_file(target_path, source_df, marked_columns, key_column_original, header_row, source_filename, marker_value):
    try:
        wb = load_workbook(target_path)
        ws = wb.active

        header_cells = list(ws.iter_rows(min_row=header_row, max_row=header_row))[0]

        key_col_index = None
        for i, cell in enumerate(header_cells, 1):
            if cell.value and str(cell.value).strip().rstrip(".,").lower() == key_column_original.strip().rstrip(".,").lower():
                key_col_index = i
                break

        if not key_col_index:
            raise ValueError(f"Key column '{key_column_original}' not found in target file.")

        column_dict = {str(cell.value).strip().rstrip(".,").upper(): idx
                       for idx, cell in enumerate(header_cells, 1)
                       if cell.value and str(cell.value).strip()}

        new_column_index = len(column_dict) + 1
        for col in marked_columns:
            name = str(col).strip().upper()
            if name not in column_dict:
                ws.cell(row=header_row, column=new_column_index, value=col)
                column_dict[name] = new_column_index
                new_column_index += 1

        marker_map = {}
        for _, row in source_df.iterrows():
            key_value = str(row[key_column_original]).strip().upper() if pd.notna(row[key_column_original]) else None
            if not key_value:
                continue
            for col in marked_columns:
                if pd.notna(row[col]):
                    marker_map.setdefault(key_value, []).append(col)

        update_count = 0
        for row_idx in range(header_row + 1, ws.max_row + 1):
            key_cell = ws.cell(row=row_idx, column=key_col_index)
            key_value = str(key_cell.value).strip().upper() if key_cell.value else None
            if key_value and key_value in marker_map:
                for col in marker_map[key_value]:
                    name = str(col).strip().upper()
                    if name in column_dict:
                        col_idx = column_dict[name]
                        ws.cell(row=row_idx, column=col_idx, value=marker_value)
                        update_count += 1

        wb.save(target_path)

        if update_count > 0:
            messagebox.showinfo(f"Updated by {source_filename}", f"{update_count} cells updated from\n{source_filename}")
        else:
            messagebox.showinfo("No Changes", f"No '{marker_value}' values from {source_filename} found in the target file.")

        return update_count
    except Exception as e:
        messagebox.showerror("Error", f"Error updating the target file:\n\n{str(e)}")
        raise

#################################### Main Function

def main():
    global splash_window

    splash_window = show_background_splash()

    source_files = select_multiple_files("Select the source Excel file(s)")
    target_file = select_single_file("Select the target Excel file")

    while True:
        header_row = ask_header_row()
        try:
            df = pd.read_excel(source_files[0], header=header_row - 1)
        except Exception as e:
            messagebox.showerror("Error", f"Could not open first source file:\n{source_files[0]}\n\n{str(e)}")
            continue

        key_column_input = ask_key_column_name(df.columns)
        normalized_columns = {str(col).strip().rstrip(".,").lower(): col for col in df.columns}

        if key_column_input not in normalized_columns:
            messagebox.showerror("Column Not Found", f"Column '{key_column_input}' was not found.\n\nAvailable columns:\n" +
                                 "\n".join([str(c) for c in df.columns]))
            continue

        break

    key_column = key_column_input
    marker_value = ask_marker_value()

    total_updates = 0
    for source_file in source_files:
        marked_columns, source_df, key_col = find_marked_columns(source_file, header_row, key_column, marker_value)
        if not marked_columns or source_df is None or key_col is None:
            continue
        try:
            updates = update_target_file(target_file, source_df, marked_columns, key_col, header_row, os.path.basename(source_file), marker_value)
            total_updates += updates
        except Exception as e:
            print(f"Skipped {source_file} due to error: {e}")

    if total_updates == 0:
        messagebox.showinfo("No Marker Value Found", f"No cells were updated.\nThe marker value '{marker_value}' was not found in any of the source files.")

    if splash_window is not None:
        splash_window.destroy()

#################################### R U N

if __name__ == "__main__":
    main()

